  onAlertDismiss() {
    this.alertOptions = {
      displayAlert: false,
      displayStatus: ''
    };
  }

  closeTransactionsCategory(categoryChangeStatus) {
    if (categoryChangeStatus) {
      this.alertOptions = {
        displayAlert: true,
        displayStatus: categoryChangeStatus
      };
    } else {
      this.onAlertDismiss();
